import React, {Component, Fragment} from 'react'
import DeskTopLayout from '../../components/layouts/deskTopLayout'

class AppDownload extends Component {
  render() {

    return (
      <Fragment>
        <DeskTopLayout>
          <h1>AppDownload</h1>
          <div className="about">
            AppDownload
          </div>

        </DeskTopLayout>
      </Fragment>

    )
  }
}

export default AppDownload
